import{_ as a,W as e,X as s,a2 as t}from"./framework-3a0c4e99.js";const r={},i=t(`<h1 id="windows设置frpc开机自动启动-不管用户是否登陆都要运行" tabindex="-1"><a class="header-anchor" href="#windows设置frpc开机自动启动-不管用户是否登陆都要运行" aria-hidden="true">#</a> Windows设置frpc开机自动启动(不管用户是否登陆都要运行)</h1><h3 id="新建start-bat-内容如下-放到自己frpc实际目录下" tabindex="-1"><a class="header-anchor" href="#新建start-bat-内容如下-放到自己frpc实际目录下" aria-hidden="true">#</a> 新建start.bat,内容如下(放到自己frpc实际目录下):</h3><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code>@echo off
:home
frpc <span class="token parameter variable">-c</span> frpc.ini
goto home
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="打开开始菜单-输入-任务计划程序-将会自动搜索-接着打开它。" tabindex="-1"><a class="header-anchor" href="#打开开始菜单-输入-任务计划程序-将会自动搜索-接着打开它。" aria-hidden="true">#</a> 打开开始菜单，输入 “任务计划程序” 将会自动搜索，接着打开它。<img src="https://img-blog.csdnimg.cn/20200929111009349.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L2dkYWxp,size_16,color_FFFFFF,t_70" alt="" loading="lazy"></h3><p>点击右侧的 “创建任务”，名称随意填写，安全选项选择 “不管用户是否登录都要运行”，当然你也可以选择 “只在用户登录时运行”。</p><p>选择 “不管用户是否登录都要运行” 可以让你的电脑在断电自动启动后自动运行 frp，你就可以远程桌面连接电脑了。</p><p>“使用最高权限运行” 也是可选的，根据个人需要可以选上。</p><p>最后勾选 “隐藏”，就不会在启动时弹出命令行窗口了。</p><figure><img src="https://img-blog.csdnimg.cn/20200929111043192.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L2dkYWxp,size_16,color_FFFFFF,t_70" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>接着转到 “触发器” 页，点击新建，选择 “启动时” <img src="https://img-blog.csdnimg.cn/20200929111107766.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L2dkYWxp,size_16,color_FFFFFF,t_70" alt="" loading="lazy"></p><p>接着转到 “操作” 页，点击新建，选择 “启动程序”</p><p>在程序或脚本一栏选择第一步创建的 start.bat，下面的 “起始于” 填写 start.bat 的路径（不要包含 start.bat）</p><p>例如你的 start.bat 在 E:\\frp\\start.bat，那么你只需要在 “起始于” 填写 E:\\frp<br><img src="https://img-blog.csdnimg.cn/20200929111151748.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L2dkYWxp,size_16,color_FFFFFF,t_70" alt="" loading="lazy"> 接着返回 “常规” 页，点击确定，此时会要求输入密码，输入你的电脑密码，然后点击确定即可。</p><p>以后就会开机自动启动 frp 了，并且不会弹出命令提示符窗口。</p>`,14),n=[i];function p(c,o){return e(),s("div",null,n)}const _=a(r,[["render",p],["__file","Windows设置frpc开机自动启动(不管用户是否登陆都要运行).html.vue"]]);export{_ as default};
